package com.example.imagetext;

import android.os.Bundle;
import android.view.View;
import android.widget.Button;
import android.widget.TextView;

import androidx.activity.EdgeToEdge;
import androidx.appcompat.app.AppCompatActivity;

import androidx.recyclerview.widget.GridLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import java.util.ArrayList;
import java.util.List;
import java.util.stream.Collectors;

public class MainActivity extends AppCompatActivity {
    private Button btButton;
    private TextView tvTotal;
    private RecyclerView rcvImage;
    private ImageAdapter mImageAdapter;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        EdgeToEdge.enable(this);
        setContentView(R.layout.activity_main);
        rcvImage = findViewById(R.id.rcv_image);
        btButton = findViewById(R.id.bt_home);
        tvTotal = findViewById(R.id.tv_total);

        //ham khoi tao
        mImageAdapter = new ImageAdapter(this);

        GridLayoutManager gridLayoutManager = new GridLayoutManager(this, 3);
        rcvImage.setLayoutManager(gridLayoutManager);
        mImageAdapter.setData(getListImage());
        rcvImage.setAdapter(mImageAdapter);

        //danh sach ban dau
//        tvTotal.setText(Integer.toString(getListImage().size()));

        btButton.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                mImageAdapter.setData(filter());

            }
        }
        );


    }

    private List<Image> getListImage() {
        List<Image> list = new ArrayList<>();
        list.add(new Image("data:image/jpeg;base64,", 2));
        list.add(new Image("data:image/jpeg;base64,", 2));
        list.add(new Image("data:image/jpeg;base64,", 2));
        list.add(new Image("data:image/jpeg;base64,", 3));
        list.add(new Image("data:image/jpeg;base64,", 4));
        list.add(new Image("data:image/jpeg;base64,", 5));
        list.add(new Image("data:image/jpeg;base64,", 6));
        list.add(new Image("data:image/jpeg;base64,", 4));
        list.add(new Image("data:image/jpeg;base64,", 2));

        return list;
    }

//    private List<Image> filter(List<Image> list) {
//        return list.stream().filter(m -> m.getNumber() % 2 != 0).collect(Collectors.toList());
//    }

    private List<Image> filter() {

        List<Image> listOdd = new ArrayList<>();
        for (Image image : getListImage()
        ) {
            if (image.getNumber() % 2 != 0) {
                listOdd.add(image);
            }
        }
        return listOdd;
    }
}